var maintenant = new Date();
var jour = maintenant.getDate();
var mois = maintenant.getMonth() + 1; // Attention : JavaScript compte les mois à partir de 0
var annee = maintenant.getFullYear();
var heures = maintenant.getHours();
var minutes = maintenant.getMinutes();
var secondes = maintenant.getSeconds();

// Formater les chiffres pour qu'ils aient toujours deux chiffres (par exemple, 01 au lieu de 1)
if (jour < 10) {
    jour = '0' + jour;
}
if (mois < 10) {
    mois = '0' + mois;
}
if (heures < 10) {
    heures = '0' + heures;
}
if (minutes < 10) {
    minutes = '0' + minutes;
}
if (secondes < 10) {
    secondes = '0' + secondes;
}

var dateActuelle = jour + '/' + mois + '/' + annee;
var heureActuelle = heures + ':' + minutes + ':' + secondes;

msg.payload = "Date : " + dateActuelle + " - Heure : " + heureActuelle;
return msg;

if (msg.payload === "pressed") {
